import './App.css';
import React, {useEffect, useState} from "react";
import MainServices from "./services/MainServices";
import AppHeader from "./components/AppHeader";

function App() {
    const [machineList, setMachineList] = useState([])

    useEffect(() => {
        GetMachine()
    }, [])

    async function GetMachine() {
        try {
            const resp = await MainServices.getAllMachine();
            setMachineList(resp.data || []);
        } catch (e) {
            console.error(e)
        }
    }

    return (
        <>
            <AppHeader/>
            <div className='md:container md:mx-auto'>
                <div className="flex justify-between m-6">
                    <div className="flex flex-col h-full max-w-lg mx-auto bg-gray-800 rounded-lg">
                        <img
                            className="rounded-lg rounded-b-none"
                            src="/img/logo.png"
                            alt="thumbnail"
                            loading="lazy"
                        />

                        <div className="py-2 px-4">
                            <h1
                                className="text-xl font-medium leading-6 tracking-wide text-gray-300 hover:text-blue-500 cursor-pointer"
                            >
                                <a href="blog/detail">JIT Mode - A faster, more powerful, on-demand engine for
                                    tailwind</a>
                            </h1>
                        </div>
                        <div className="px-4 space-y-2">
                            <p className="text-gray-400 font-normal leading-5 tracking-wide">
                                Tailwind CSS v2.1 introduces a new just-in-time compiler for Tailwind CSS that generates
                                your styles on-demand...
                            </p>
                            <router-link
                                to="blog/detail"
                                className="font-bold hover:text-blue-400 text-gray-100"
                            >read more...
                            </router-link
                            >
                        </div>
                    </div>
                </div>
            </div>
        </>
    )
        ;
}

export default App;
